import React,{Component} from "react";
import axios from 'axios';

export default class EMPL_LIST extends Component{
    constructor(props) {
        super(props);
        this.state={
            employee_id : '',
            employee_name : 'no name'
        }
    }
    componentDidMount() {
        axios.get('https://jsonplaceholder.typicode.com/todos/1')
            .then(function (response) {
                this.setState({employee_id : response.userID,employee_name : response.title})
            })
            .catch(function (error) {
                console.log(error);
            });
    }
    render(){
        return(
            <div>
                <h1>{this.state.employee_name}</h1>
            </div>
        )
    }
}
